import React from 'react';
import TextLink from '../components/TextLink/index'

export default {
  title: 'Text Link',
  component: TextLink
}

export function TextLinkContainer() {

  return (
    <div>
      <TextLink content="Example 1"/>
      <TextLink content="Example 2"/>
      <TextLink content="Example 3"/>
    </div>
  )
}
